using System;
using System.IO;
using System.Threading.Tasks;
using Qkmaxware.Astro.Control.Devices;
using Qkmaxware.Measurement;

namespace Qkmaxware.Astro.Control.Devices {

/// <summary>
/// Simulated CCD image
/// </summary>
public class SimulatedImage : ICameraImage {
    private static string Base64 = "";

    public string SaveFile(string path) {
        if (!string.IsNullOrEmpty(path)) {
            var dir = System.IO.Path.GetDirectoryName(path);
            var filename = System.IO.Path.GetFileNameWithoutExtension(path);
            var full_path = System.IO.Path.Combine(dir, filename + ".png");

            File.WriteAllBytes(full_path, Convert.FromBase64String(Base64));

            return full_path;
        } else {
            return null;
        }
    }
}

/// <summary>
/// Simulated CCD
/// </summary>
public class SimulatedCcd : ICamera {
    public bool IsCoolingEnabled {get; private set;}

    public string Name => ".Net Simulated CCD";

    public bool IsConnected => true;

    public void Connect() {}

    public void DisableCooling() {
        IsCoolingEnabled = false;
    }

    public void Disconnect() {}

    public void EnableCooling() {
        IsCoolingEnabled = true;
    }

    public Task<ICameraImage> ExposeAsync(Duration timespan, Binning binning) {
        return Task.Run(() => {
            // Wait for exposure
            Task.Delay(TimeSpan.FromSeconds((double)timespan.TotalSeconds())).Wait();
            // Return image
            return (ICameraImage)(new SimulatedImage());
        });
    }
}

}